const Main = () => {
    const template = 
    `
    <div class="title-wrap">
                <h1>I'm <span> Phinehas Lamptey</span></h1>
                <!-- <span class="txt-rotate"></span>-->
                <h2>I am full stack web developer</h2>
                <p>
                    Hit me Up for your projects
                </p>
                <div class="getintouch">
                    <div><a href="#contact" class="btn">Get In Touch</a></div>
                </div>
            </div>
    `;
    return template;
}
export default Main;
